@mercedesbenz will conclude its involvement in the @mercedeseqfe Team at the end of Season 8 and refocus resource for electric-only vehicle development.

Ian James: "Although Mercedes-Benz has decided to leave, we recognise the value and power of Formula E; therefore, we will be exploring the best options for the team to continue competing beyond Season 8."

Toto Wolff: "We can be proud of our achievements in Formula E and especially the double world championship win, an historic milestone in Mercedes-Benz motorsport history."
